import React from "react";
import GroupedSelect from "./components/groupedSelect.jsx";
import SingleSelect from "./components/singleSelect.jsx";
import "./App.css";

function App() {
  state = {
    counters: [
      { id: 1, value: 4 },
      { id: 2, value: 0 },
      { id: 3, value: 0 },
      { id: 4, value: 0 },
    ],
  };
  return (
    <div>
      <h1 className="App-header">NEANEX QUERY BUILDER</h1>
      <main className="Main">
        <div className="InputBox">
          <div className="Input">
            <GroupedSelect />
          </div>
          <div className="Input">
            <SingleSelect />
          </div>
        </div>
        <button className="btn btn-warning btn-lg m-4">+</button>
      </main>
    </div>
  );
}

export default App;
